import './App.css';
import Footer from './pages/footer';
import Header from './pages/header';
import Intro from './pages/intro';


function App() {
  return (
    <div className="App">
    <Header/>
    <main>
      <Intro/>
      <Product/>
    </main>

    <Footer/>
    </div>
  );
}

export default App;
